import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './apiData.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const GetData = () => {
  const [apiData, setApiData] = useState();
  const api = 'https://front-end-test-bvhzjr6b6a-uc.a.run.app';

  useEffect(() => {
    axios.get(api)
      .then(res => {

        console.log(res.data);

        setApiData(res.data.map((el, i) => {

          if (typeof el.tampons === 'string') {
            // console.log(JSON.stringify(el.tampons));

            let parser = new DOMParser();
            let xmlDoc = parser.parseFromString(el.tampons, "text/xml");
            console.log(xmlDoc);
          }

          return (
            <div className="product-wrapper col-4" key={i}>
              <img className="product-img" alt="picture" src={el.productImage} />
              <p>
                {el.currency}
              </p>
              <p>{el.price}</p>

              <div>
                {el.tampons}
              </div>
            </div>
          );
        }));

      })
  },[]);

  return (
   <div className="container">
    <div className="row">
      {apiData}
    </div>
   </div>
  )
};

export default GetData;
